<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Disson Lab â€” Hero Mockup v3</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600&family=Playfair+Display:wght@500;600&display=swap" rel="stylesheet">
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        :root {
            --sage-green: #87A878;
            --forest-green: #2D4739;
            --cream: #FDFBF7;
            --wood: #D4C4B0;
            --text-dark: #2C2C2C;
        }
        body {
            font-family: 'Inter', sans-serif;
            background: var(--cream);
            color: var(--text-dark);
            -webkit-font-smoothing: antialiased;
        }
        .hero {
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            text-align: center;
            position: relative;
            overflow: hidden;
        }
        .hero-bg {
            position: absolute;
            top: 0; left: 0;
            width: 100%; height: 100%;
            object-fit: cover;
            z-index: 0;
            transform: scaleX(-1);
        }
        .hero-overlay {
            position: absolute;
            top: 0; left: 0;
            width: 100%; height: 100%;
            background: radial-gradient(ellipse at center, rgba(253,251,247,0.4) 0%, transparent 70%);
            z-index: 1;
        }
        .hero-content {
            position: relative;
            z-index: 2;
            max-width: 900px;
            padding: 40px;
        }
        .logo {
            font-family: 'Playfair Display', serif;
            font-size: clamp(3rem, 8vw, 5rem);
            font-weight: 600;
            color: var(--forest-green);
            letter-spacing: -0.02em;
            margin-bottom: 8px; /* REDUCED from 20px */
            text-shadow: 0 2px 20px rgba(253,251,247,0.5);
        }
        .logo span { font-weight: 500; color: var(--sage-green); }
        .tagline {
            font-family: 'Inter', sans-serif;
            font-size: clamp(1rem, 2.5vw, 1.25rem);
            font-weight: 400;
            color: var(--forest-green);
            letter-spacing: 0.05em;
            margin-bottom: 48px;
            opacity: 0.85;
            line-height: 1.6;
        }
        .tagline .highlight {
            font-weight: 600;
            color: var(--sage-green);
        }
        .cta {
            display: inline-flex;
            align-items: center;
            gap: 12px;
            padding: 18px 40px;
            background: var(--forest-green);
            color: var(--cream);
            font-size: 1rem;
            font-weight: 500;
            text-decoration: none;
            border-radius: 100px;
            transition: all 0.3s ease;
            box-shadow: 0 4px 20px rgba(45, 71, 57, 0.3);
        }
        .cta:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 30px rgba(45, 71, 57, 0.4);
            background: #3a5a48;
        }
        .cta svg { width: 20px; height: 20px; transition: transform 0.3s ease; }
        .cta:hover svg { transform: translateX(4px); }
        nav {
            position: fixed;
            top: 0; left: 0; right: 0;
            z-index: 100;
            padding: 24px 40px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            background: rgba(253,251,247,0.8);
            backdrop-filter: blur(10px);
        }
        .nav-logo {
            font-family: 'Playfair Display', serif;
            font-size: 1.5rem;
            font-weight: 600;
            color: var(--forest-green);
            text-decoration: none;
        }
        .nav-logo span { color: var(--sage-green); }
        .nav-links { display: flex; gap: 32px; align-items: center; }
        .nav-links a {
            font-size: 0.9rem;
            font-weight: 500;
            color: var(--forest-green);
            text-decoration: none;
            opacity: 0.8;
            transition: opacity 0.2s;
        }
        .nav-links a:hover { opacity: 1; }
        .nav-cta {
            padding: 10px 24px !important;
            background: var(--forest-green) !important;
            color: var(--cream) !important;
            border-radius: 100px !important;
            opacity: 1 !important;
        }
        .scroll-indicator {
            position: absolute;
            bottom: 40px;
            left: 50%;
            transform: translateX(-50%);
            z-index: 2;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 8px;
            color: var(--forest-green);
            opacity: 0.6;
            animation: bounce 2s infinite;
        }
        .scroll-indicator span { font-size: 0.75rem; letter-spacing: 0.1em; text-transform: uppercase; }
        @keyframes bounce {
            0%, 20%, 50%, 80%, 100% { transform: translateX(-50%) translateY(0); }
            40% { transform: translateX(-50%) translateY(-10px); }
            60% { transform: translateX(-50%) translateY(-5px); }
        }
        @media (max-width: 768px) {
            nav { padding: 16px 20px; }
            .nav-links { display: none; }
            .hero-content { padding: 20px; }
            .cta { padding: 16px 32px; }
        }
    </style>
</head>

            <a href="#services">Services</a>
            <a href="#portfolio">Portfolio</a>
            <a href="#contact" class="nav-cta">Contact</a>
        </div>
    </nav>
